async function query() {  
  this.loading = true
  const { pagination, sorter } = this
  const { value } = $comp['Search']
  const { userInfo: $u } = $info;
  if (value.time) {
    const begin = value.time[0] ? `${value.time[0]} 00:00:00` : undefined
    const end = value.time[1] ? `${value.time[1]} 23:59:59` : undefined
    value.begintime_ge = begin
    value.begintime_le = end
  }
  const params = Object.assign({
    ccusercode : $u.userCode,
    ['(like)username_lk'] : value.username,
    ['(datetime)begintime_ge']: value.begintime_ge,
    ['(datetime)begintime_le']: value.begintime_le
  }, pagination, sorter)
  try {
    // 查询接口，修改接口id
    const { 
      objList, 
      pageDesc, 
    } = await $dde.get('9b2e4252eeae4a4a917d4e30020d0c51', { params }) // FIXME
    this.value = objList
    this.pagination = pageDesc
  } finally {
    this.loading = false   
  }
}

